import axios from 'axios';
import FormData from 'form-data';
import * as actionTypes from './actionTypes';

export const submitAppointmentSuccess = (success) => {
  return {
    type: actionTypes.SUBMIT_APPOINTMENT_SUCCESS,
    success
  };
};

export const submitAppointmentFailure = (error) => {
  return {
    type: actionTypes.SUBMIT_APPOINTMENT_FAILURE,
    error: error
  };
};

export const submitAppointment = (appointmentData) => {
  return dispatch => {
    let userData = new FormData();
    for (const key in ['appdate','phyname', 'clinicname', 'pt_price', 'clinicaddress', 'cliniccontact', 'cityname']) {
      userData.append(key, appointmentData[key]);
    }
    // dispatch(submitAppointmentSuccess({'success': 1, 'message': 'appointment created', 'appointmentId': 123344 }));
    axios.post(actionTypes.API_URL + "Appointments/create/", userData).then(
      response => {
        // console.log('inside profile update call');
        // console.log(JSON.stringify(response.data));
        let userProfile = response.data;
        if (response.data.success === 1) {
          dispatch(userUpdateSuccess(userProfile));
        } else {
          dispatch(userUpdateFailure(userProfile.error.errormsg));
        }
      }).catch(err => {
      console.log(err);
    });
  };
};
